description:
Category	Feature, Plot Based, Horror

Starring	Jayden Jaymes, Nikki Benz, Mia Malkova, Chloe Amour, Karlie Montana, Stevie Shae

Six people are invited by the spirits of a haunted house to participate in a gamble for their lives in exchange of one million dollars! These young and horny fools don't have a clue what gore is in store, as they embark on this scary venture around the house. They separate in pairs to find an exit, but as fear lingers, it hauntingly arouses them. Each lecherous couple screw away their fears and reach their most intense orgasm before the heinous acts of the night begin! A-list cast starring Jayden Jaymes, Nikki Benz, Mia Malikova, Stevie Shae, Karlie Montana, and Chloe Amour for a night of climatic screams and horror.

